Insert into MRVMM.T_MAE_MEDMIT (ID_MEDMIT,NUMERO_MEDMIT,NOMBRE_MEDMIT,DESCRIPCION_MEDMIT,ID_NAMA,OBJETIVO_MEDMIT,IPSC_MEDMIT,FLAG_ESTADO,GEI_TOTAL,GEI_PUBLICO,GEI_PRIVADO,CANT_TOTAL,CANT_PUBLICO,CANT_PRIVADO,ASOCIADO,ID_IPCC,ADJUNTO,ADJUNTO_BASE) values ('12','PVE','Promoción de vehículos eléctricos - PVE','Medida que propone reemplazar la matriz energética utilizada en el transporte, la cual utiliza predominantemente combustibles fósiles (gasolina, diésel, gas licuado de petróleo y gas natural vehicular), mediante una mayor participación de vehículos eléctricos en el parque vehicular, contribuyendo al cumplimiento del Plan Energético Nacional 2014-2025 y reduciendo las emisiones de gases de efecto invernadero (GEI) gracias al reemplazo o al desplazamiento de vehículos que consumen gasolina o diésel por nuevos vehículos eléctricos. La meta trazada para esta medida de mitigación en una primera etapa se da bajo 2 acciones: i) la introducción de ómnibus eléctricos y ii) introducción de vehículos livianos eléctricos.','4','Reemplazar la matriz energética utilizada de manera predominante en el transporte (gasolina, diésel, GLP, GNV), a vehículos eléctricos. ','Energía - Combustión móvil','1','-2369','-1890','-479','6','4','2','104','1',null,null);
Insert into MRVMM.T_MAE_MEDMIT (ID_MEDMIT,NUMERO_MEDMIT,NOMBRE_MEDMIT,DESCRIPCION_MEDMIT,ID_NAMA,OBJETIVO_MEDMIT,IPSC_MEDMIT,FLAG_ESTADO,GEI_TOTAL,GEI_PUBLICO,GEI_PRIVADO,CANT_TOTAL,CANT_PUBLICO,CANT_PRIVADO,ASOCIADO,ID_IPCC,ADJUNTO,ADJUNTO_BASE) values ('1','EEE','Etiquetado de Eficiencia Energética - EEE','Esta medida propone que los equipos que requieran suministros energéticos incluyan en sus etiquetas, envases, empaques y publicidad, una etiqueta de eficiencia energética a través de la cual el consumidor pueda conocer el consumo de energía y la eficiencia energética del producto para la toma de decisión de consumo, reduciendo así las emisiones de GEI debido a la reducción del consumo de energía asociada a la mejora de eficiencia de los nuevos equipos a ser adquiridos por los consumidores. La medida se enmarca en el Reglamento Técnico sobre el etiquetado de eficiencia energética para equipos energéticos, aprobado mediante Decreto Supremo N°009-2017-EM.','1','Dar cumplimiento al Reglamento Técnico sobre el etiquetado de eficiencia energética para equipos energéticos, aprobado mediante Decreto Supremo N°009-2017-EM. Puede incluir aparatos de refrigeración, calderas, motores eléctricos, lavadoras, secadoras, equipos de aire acondicionado y calentadores de agua. No incluye luminarias. ','Energía - Combustión estacionaria','1','-318','-180','-138','4','2','2','81','1',null,null);
Insert into MRVMM.T_MAE_MEDMIT (ID_MEDMIT,NUMERO_MEDMIT,NOMBRE_MEDMIT,DESCRIPCION_MEDMIT,ID_NAMA,OBJETIVO_MEDMIT,IPSC_MEDMIT,FLAG_ESTADO,GEI_TOTAL,GEI_PUBLICO,GEI_PRIVADO,CANT_TOTAL,CANT_PUBLICO,CANT_PRIVADO,ASOCIADO,ID_IPCC,ADJUNTO,ADJUNTO_BASE) values ('2','EESI','Eficiencia Energética en el sector industrial - EESI','Esta medida de mitigación, propuesta por el Ministerio de Energía y Minas, propone la implementación de medidas de eficiencia energética en empresas del sector industrial fomentando la competitividad de la economía nacional y reduciendo el impacto ambiental negativo del uso y consumo de los energéticos como la reducción de emisiones de GEI. Esta medida se enmarca en la Ley de Promoción del Uso Eficiente de la Energía, Ley N°27345, y su Reglamento aprobado por Decreto Supremo N°053-2007-EM. Así, se prevé considerar el recambio de motores y calderas, una vez que se viabilice el Fondo de Financiamiento a la Eficiencia Energética (FOFEE)','1','Fomentar la competitividad de la economía nacional y reducir el impacto ambiental negativo del uso y consumo de los energéticos mediante la Ley de Promoción del Uso Eficiente de la Energía  Ley N°27345 y su Reglamento, aprobado por Decreto Supremo N°053-2007-EM.','Energía - Combustión estacionaria','1','-1605','-1200','-405','6','3','3','0','2',null,null);
Insert into MRVMM.T_MAE_MEDMIT (ID_MEDMIT,NUMERO_MEDMIT,NOMBRE_MEDMIT,DESCRIPCION_MEDMIT,ID_NAMA,OBJETIVO_MEDMIT,IPSC_MEDMIT,FLAG_ESTADO,GEI_TOTAL,GEI_PUBLICO,GEI_PRIVADO,CANT_TOTAL,CANT_PUBLICO,CANT_PRIVADO,ASOCIADO,ID_IPCC,ADJUNTO,ADJUNTO_BASE) values ('3','EESC','Eficiencia energética en el sector comercial - EESC','Medida que propone promover la racionalización del consumo de energía en el sector comercial de servicios.','1','Promover la racionalización del consumo de energía en el sector comercial de servicios, a través de: a) reemplazo de lámparas de baja eficiencia por lámparas LED de 10W y b) instalación de sensores de ocupación hotelera, con el objetivo de controlar las unidades de aire acondicionado.','Energía - Combustión estacionaria','1','-313','-250','-63','9','5','4','0','2',null,null);
Insert into MRVMM.T_MAE_MEDMIT (ID_MEDMIT,NUMERO_MEDMIT,NOMBRE_MEDMIT,DESCRIPCION_MEDMIT,ID_NAMA,OBJETIVO_MEDMIT,IPSC_MEDMIT,FLAG_ESTADO,GEI_TOTAL,GEI_PUBLICO,GEI_PRIVADO,CANT_TOTAL,CANT_PUBLICO,CANT_PRIVADO,ASOCIADO,ID_IPCC,ADJUNTO,ADJUNTO_BASE) values ('4','AESP','Auditorías energéticas en el sector público - AESP','Medida que propone implementar acciones que contribuyan a reducir el consumo de energía sin que estas acciones afecten la calidad de los servicios prestados y recibidos en las entidades del sector público cuya facturación mensual por consumo de energía eléctrica sea mayor de cuatro (4) unidades impositivas tributarias (UIT), reduciendo así las emisiones de GEI debido a la reducción del consumo energético. Asimismo, prevé que en un futuro las auditorías energéticas puedan desarrollarse para el sector privado, bajo el mecanismo de un fondo de eficiencia energética.','1','Implementar acciones que contribuyan a reducir el consumo de energía sin que estas acciones afecten la calidad de los servicios prestados y recibidos en las entidades del sector público. Incluye todo equipo que consuma electricidad (con y sin fichas de homologación) con excepción de lámparas con fichas.','Energía - Combustión estacionaria','1','-811','-600','-211','6','2','4','0','2',null,null);
Insert into MRVMM.T_MAE_MEDMIT (ID_MEDMIT,NUMERO_MEDMIT,NOMBRE_MEDMIT,DESCRIPCION_MEDMIT,ID_NAMA,OBJETIVO_MEDMIT,IPSC_MEDMIT,FLAG_ESTADO,GEI_TOTAL,GEI_PUBLICO,GEI_PRIVADO,CANT_TOTAL,CANT_PUBLICO,CANT_PRIVADO,ASOCIADO,ID_IPCC,ADJUNTO,ADJUNTO_BASE) values ('5','IRS','Transformación del mercado de Iluminación en el Sector Residencial - ISR','Medida que promueve la sustitución de lámparas de baja eficiencia por tecnologías más eficientes de iluminación, reduciendo las emisiones de GEI debido al menor uso de energía, y generando la transformación hacia un mercado de iluminación más eficiente, cuyo principal objetivo es promover el uso de lámparas que permitan un uso eficiente de la energía en el país, sin menoscabar la calidad de la iluminación, considerando los beneficios económicos, ambientales y sociales que se tendrían en el país. La medida de mitigación propone dos fases: i) el programa de distribución de un millón y medio de lámparas energéticamente más eficientes a hogares de menores ingresos como meta al 2019, en el marco del Programa Anual de Promociones 2018, aprobado mediante Resolución Ministerial Nº 021-2018-MINEM/DM, de acuerdo a lo establecido en el Plan de Acceso Universal a la Energía 2013-2022, aprobado con Resolución Ministerial Nº 203-2013-MINEM-DM; y ii) la Estrategia de Iluminación del Perú, cuyo objetivo es incrementar la participación de las lámparas eficientes en el mercado de iluminación nacional, reduciendo el consumo de energía y por ende también reduciendo las emisiones de gases de efecto invernadero (como el CO2).','1','Promover el uso de lámparas que permitan un uso eficiente de la energía en el país, sin menoscabar la calidad de la iluminación, considerando los beneficios económicos, ambientales y sociales que se tendrían en el país. Aplica para lámparas LED.','Energía - Combustión estacionaria','1','-486','-400','-86','1','1','0','241','2',null,null);
Insert into MRVMM.T_MAE_MEDMIT (ID_MEDMIT,NUMERO_MEDMIT,NOMBRE_MEDMIT,DESCRIPCION_MEDMIT,ID_NAMA,OBJETIVO_MEDMIT,IPSC_MEDMIT,FLAG_ESTADO,GEI_TOTAL,GEI_PUBLICO,GEI_PRIVADO,CANT_TOTAL,CANT_PUBLICO,CANT_PRIVADO,ASOCIADO,ID_IPCC,ADJUNTO,ADJUNTO_BASE) values ('6','LSP','Reemplazo de lámparas en sector público - LSP','Reemplazo de lámparas de baja eficiencia por lámparas LED en el sector público reduciendo así el consumo de energía y por ende reduciendo también las emisiones de GEI, con el objetivo de impulsar el uso de lámparas y otros equipos de iluminación LED en todas las instituciones públicas. La medida se implementa a través de las fichas de homologación de tecnología LED, aprobadas por el MINEM, y que son instrumentos que permiten el reemplazo de luminarias menos eficientes por lámparas y otros equipos de iluminación LED en los procesos de compras públicas, lo que permite además la inclusión de estas tecnologías en la implementación de nuevos establecimientos estatales.'',''1'',''Impulsar el uso de lámparas eficientes en el sector público a través de las Fichas de Homologación de lámparas de tecnología LED. Aplica para lámparas LED. ','1','Impulsar el uso de lámparas eficientes en el sector público a través de las Fichas de Homologación de lámparas de tecnología LED. Aplica para lámparas LED.Impulsar el uso de lámparas eficientes en el sector público a través de las Fichas de Homologación de lámparas de tecnología LED. Aplica para lámparas LED. ','Energía - Combustión estacionaria','1','-278,4','-160','-118,4','10','7','3','0','2',null,null);
Insert into MRVMM.T_MAE_MEDMIT (ID_MEDMIT,NUMERO_MEDMIT,NOMBRE_MEDMIT,DESCRIPCION_MEDMIT,ID_NAMA,OBJETIVO_MEDMIT,IPSC_MEDMIT,FLAG_ESTADO,GEI_TOTAL,GEI_PUBLICO,GEI_PRIVADO,CANT_TOTAL,CANT_PUBLICO,CANT_PRIVADO,ASOCIADO,ID_IPCC,ADJUNTO,ADJUNTO_BASE) values ('7','LAP','Lámparas de alumbrado público - LAP','Medida que promueve la implementación de lámparas de alta eficiencia en el alumbrado público reduciendo las emisiones de GEI debido al menor uso de energía, en el marco del Plan de Acceso Universal a la Energía (RM N°203-2013-MINEM/DM) y en donde se incluye el reemplazo de 100,000 lámparas de vapor de sodio de alta presión (VSAP) en alumbrado público por lámparas LED o de inducción, priorizando zonas vulnerables. Además, contempla una segunda fase a través de la implementación de las fichas de homologación de alumbrado público.','1','Reemplazo de lámparas de alumbrado público de vapor de sodio de alta presión por lámparas LED consiste en la implementación de lámparas de alta eficiencia en el alumbrado público. Aplica para lámparas LED con fichas de homologación, 100,000 de FISE. ','Energía - Combustión estacionaria','1','-1035','-955','-80','1','1','0','0','2',null,null);
Insert into MRVMM.T_MAE_MEDMIT (ID_MEDMIT,NUMERO_MEDMIT,NOMBRE_MEDMIT,DESCRIPCION_MEDMIT,ID_NAMA,OBJETIVO_MEDMIT,IPSC_MEDMIT,FLAG_ESTADO,GEI_TOTAL,GEI_PUBLICO,GEI_PRIVADO,CANT_TOTAL,CANT_PUBLICO,CANT_PRIVADO,ASOCIADO,ID_IPCC,ADJUNTO,ADJUNTO_BASE) values ('8','CL','Cocción limpia - CL','Implementación y sostenibilidad de tecnologías de cocción limpia (cocinas mejoradas y cocinas a gas licuado de petróleos) en zonas rurales, reemplazando aquellas cocinas o tecnologías convencionales (fogón abierto) poco eficientes en el ámbito rural, con lo cual se reducirá los consumos de combustibles empleados en cocinas tradicionales, tales como leña y carbón vegetal, reduciendo así emisiones de gases de efecto invernadero (GEI) y los efectos nocivos a la salud asociados a las emisiones gaseosas y del material particulado restante de la combustión.','2','Reducción de las emisiones de gases de efecto invernadero (GEI) generadas por la cocción y calentamiento de alimentos a través del uso de cocinas o tecnologías convencionales (fogón abierto) poco eficientes en el ámbito rural. Incluye: cocinas mejoradas y a gas licuado de petróleo (GLP).','Energía - Combustión estacionaria','1','-1823','-1565','-258','1','1','0','124','2',null,null);
Insert into MRVMM.T_MAE_MEDMIT (ID_MEDMIT,NUMERO_MEDMIT,NOMBRE_MEDMIT,DESCRIPCION_MEDMIT,ID_NAMA,OBJETIVO_MEDMIT,IPSC_MEDMIT,FLAG_ESTADO,GEI_TOTAL,GEI_PUBLICO,GEI_PRIVADO,CANT_TOTAL,CANT_PUBLICO,CANT_PRIVADO,ASOCIADO,ID_IPCC,ADJUNTO,ADJUNTO_BASE) values ('10','RERC','RER conectado - RERC','Aumentar la participación de los Recursos Energéticos de fuentes Renovables (RER) en la matriz energética nacional en un 6.8% en el año 2030, reduciendo la proporción de la energía producida en base a la quema de combustibles fósiles, lo cual generará la reducción de emisiones de gases de efecto invernadero (GEI). Asimismo, la medida incluye la implementación de las centrales hidroeléctricas con una capacidad instalada menor a 20 MW.','3','Aumentar la participación de los Recursos Energéticos Renovables (RER) y dar cumplimiento al Decreto Legislativo N° 1002, Ley de Promoción de la Inversión en Generación de Electricidad con el uso de Energías Renovables (2008).','Energía - Combustión estacionaria','1','-7133','-6800','-333','2','1','1','241','2',null,null);
Insert into MRVMM.T_MAE_MEDMIT (ID_MEDMIT,NUMERO_MEDMIT,NOMBRE_MEDMIT,DESCRIPCION_MEDMIT,ID_NAMA,OBJETIVO_MEDMIT,IPSC_MEDMIT,FLAG_ESTADO,GEI_TOTAL,GEI_PUBLICO,GEI_PRIVADO,CANT_TOTAL,CANT_PUBLICO,CANT_PRIVADO,ASOCIADO,ID_IPCC,ADJUNTO,ADJUNTO_BASE) values ('9','ER','Electrificación rural - ER','En elaboración','2','En elaboración','Energía - Combustión estacionaria','1','-12,6','-8','-4,6','1','1','1','0','2',null,null);
Insert into MRVMM.T_MAE_MEDMIT (ID_MEDMIT,NUMERO_MEDMIT,NOMBRE_MEDMIT,DESCRIPCION_MEDMIT,ID_NAMA,OBJETIVO_MEDMIT,IPSC_MEDMIT,FLAG_ESTADO,GEI_TOTAL,GEI_PUBLICO,GEI_PRIVADO,CANT_TOTAL,CANT_PUBLICO,CANT_PRIVADO,ASOCIADO,ID_IPCC,ADJUNTO,ADJUNTO_BASE) values ('11','GD','Generación distribuida - GD','Medida que abarca toda instalación de generación eléctrica que inyecte energía eléctrica a la red eléctrica esté conectada directamente a la Red de Distribución.','3','Promover el uso e implementación de sistemas de generación eléctrica con tecnologías limpias.','Energía - Combustión estacionaria','1','-53','-42','-11','3','2','1','0','2',null,null);
